import React from 'react'
import { Outlet, Link } from "react-router-dom";
import './builder.css'

function SidebarRow({Icon, title, to}) {
    return (
        <>
        <Link to="{to}">
            <div className="sidebarRow">
                {Icon && <Icon />}
                <p className="sidebar__title"> {title} </p>
            </div>
        </Link>
        <Outlet />
    </>
        
    )
}

export default SidebarRow
